-- ----------------------------
-- Function structure for getChildList
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildList`;
DELIMITER ;;
CREATE DEFINER=`lar`@`%` FUNCTION `getChildList`(`indexid` varchar(40),`indexcode` varchar(32),`indextype` varchar(255)) RETURNS varchar(5000) CHARSET utf8
BEGIN
DECLARE pTemp VARCHAR(5000);
	DECLARE cTemp VARCHAR(5000);
	DECLARE idTemp VARCHAR(5000);
	SET idTemp = indexid;
	SET cTemp = indexcode;
	WHILE cTemp is not NULL DO
			SET pTemp = CONCAT_WS(',',pTemp,idTemp);
			
			SELECT GROUP_CONCAT(index_id) INTO idTemp
			FROM t_index_info
			WHERE FIND_IN_SET(index_parent_code,cTemp)>0 and index_type = indextype;


			SELECT GROUP_CONCAT(index_code) INTO cTemp
			FROM t_index_info
			WHERE FIND_IN_SET(index_parent_code,cTemp)>0 and index_type = indextype;

	END WHILE;
	RETURN pTemp;
END
;;
DELIMITER ;
