INSERT INTO `easyworkflow_snapshot` VALUES ('20a5e3483e6440d49ad166e6fe135faf', '{\"_entity\":{\"galleryNameDict\":\"1\",\"artistName\":\"白百何\",\"artistBirthdayYear\":\"1984\",\"artistBirthdayMonth\":\"03\",\"artistBirthdayDay\":\"01\",\"placeOfBirthDict\":\"370200\",\"zodiacDict\":\"1\",\"politicalStatusDict\":\"13\",\"nationDict\":\"1\",\"sexDict\":\"2\",\"marriageStatusDict\":\"20\",\"nationalityDict\":\"1\",\"bloodTypeDict\":\"3\",\"artistHeight\":\"171\",\"createTime\":\"2015-11-12 09:57:33\",\"createUser\":\"c8f1ba6c7cf842409aba43206e9f7442\",\"lastmodifyTime\":\"2015-11-12 09:58:22\",\"lastmodifyUser\":\"3e33b50047394b9bafe115528f6843a8\",\"artistId\":\"b64110793a534885ad99b73fe9fe5c65\"},\"_positions\":[{\"positionOrgMix\":\"北京拾捌文化经纪有限公司\",\"nameDict\":\"演员\",\"positionBeginYear\":\"2006\",\"positionTypeMix\":\"1\",\"$$hashKey\":\"00W\"},{\"positionOrgMix\":\"XDY00000001000\",\"positionOrgMixName\":\"中国电影家协会\",\"nameDict\":\"203\",\"nameDictName\":\"理事\",\"positionTypeMix\":\"3\",\"$$hashKey\":\"011\"}],\"_delPositions\":[],\"_artistOrgs\":[],\"_delArtistOrgs\":[],\"_awards\":[],\"_delAwards\":[],\"_educations\":[],\"_delEducations\":[],\"_works\":[{\"workPerformance\":\"2007年出演拍摄了都市情感偶像剧《幸福在哪里》，饰演角色甘露。\\n2009年出演青春励志剧《我的青春谁做主》 ，剧中白百何扮演“雷蕾”一角。\\n年末，出演家庭电视剧《说谎的爱人》“董楠”一角。\\n2010年出演都市家庭电视剧《家的N次方》扮演角色赵雯。\\n2011年主演都市爱情电影《万有引力》，饰演角色女安检石晓琳。\\n2011年出演爱情电影《失恋33天》，饰演黄小仙，并获得第31届大众电影百花奖最佳女主角奖。\\n2012年出演都市职场情感电视剧《浮沉》，剧中白百何饰演角色“乔莉”。\\n同年相继参演了《整容日记》《分手合约》等电影并担纲女主角， 2012年主演当代都市情感剧《离婚前规则》，白百何出演角色蒋新瑶。\\n2013年在电影《分手合约》中出演角色何俏俏。在电影《被偷走的那五年》出演角色何蔓。在电影《私人定制》演绎角色小白 。\\n2013年一年之中登上19个知名时尚杂志的封面，白百何成为年度杂志封面人物 。\\n2014年衔主演中国首部整容题材喜剧电影《整容日记》，饰演郭晶。\\n3月参演青春励志剧《长大》。\\n11月，白百何领衔主演爱情电影《新娘日记》。\\n2015年1月，白百何与吴彦祖合作主演《滚蛋吧肿瘤君》。\",\"workCompany\":\"北京拾捌文化经纪有限公司\",\"workBeginYear\":\"2006\",\"$$hashKey\":\"013\"}],\"_delWorks\":[],\"_trains\":[],\"_delTrains\":[],\"_newsArtistRels\":[],\"_delNewsArtistRels\":[],\"_teacherStudents\":[],\"_delTeacherStudents\":[],\"_artistSects\":[],\"_delArtistSects\":[],\"_delArtistSubtypes\":[]}', '29ba605e8b1241d889564b302c8d620b', '3b21a30f06024227aed634d08f1b6653', null);
