INSERT INTO `easyworkflow_snapshot` VALUES ('26a55de55f0f408896dd1cf377f45879', '{\"_entity\":{\"galleryNameDict\":\"1\",\"artistName\":\"吴宗锡\",\"artistAliases\":\"左弦、夏史\",\"artistBirthdayYear\":\"1925\",\"artistBirthdayMonth\":\"3\",\"artistBirthdayDay\":\"1\",\"nationDict\":\"1\",\"politicalStatusDict\":\"1\",\"artistIntroduction\":\"吴宗锡，男，汉族，1925年生，江苏苏州人。笔名左弦、夏史、程芷、虞襄等。评弹理论家、作家。先后担任上海市文联副主席、上海市曲协主席、江浙沪评弹工作领导小组组长、中国曲艺音乐集成上海卷及中国曲艺志上海卷主编。\\n      评弹作品有短篇《党员登记表》，中篇《白虎岭》、《人强马壮》、《王孝和》、《芦苇青青》、《晴雯》（均与他人合作）等，此外，还改编了开篇《新木兰辞》，编写开篇《红纸伞》等。为《中国曲艺志》及《曲艺音乐集成》上海卷主编。与周良，何占春合称评弹三剑客。\",\"currentAddressDict\":\"310000\",\"nationalityDict\":\"1\",\"zodiacDict\":\"2\",\"constellationDict\":\"2\",\"createTime\":\"2015-11-12 10:47:27\",\"createUser\":\"c8f1ba6c7cf842409aba43206e9f7442\",\"lastmodifyTime\":\"2015-11-12 10:47:27\",\"lastmodifyUser\":\"c8f1ba6c7cf842409aba43206e9f7442\"},\"_positions\":[],\"_delPositions\":[],\"_artistOrgs\":[],\"_delArtistOrgs\":[],\"_awards\":[],\"_delAwards\":[],\"_educations\":[],\"_delEducations\":[],\"_works\":[],\"_delWorks\":[],\"_trains\":[],\"_delTrains\":[],\"_newsArtistRels\":[],\"_delNewsArtistRels\":[],\"_teacherStudents\":[],\"_delTeacherStudents\":[],\"_artistSects\":[],\"_delArtistSects\":[],\"_delArtistSubtypes\":[]}', 'ed2723ed59e1427881218087d47cf8db', '238e58a12dde4f8d8161b577b8d59e0e', '65e54ca8f97040a9886e11aa24c34e31');
