INSERT INTO `easyworkflow_snapshot` VALUES ('c861ad10f9a8432dbd60274b6b746f8e', '{\"_entity\":{\"galleryNameDict\":\"1\",\"artistName\":\"吴宗锡\",\"artistAliases\":\"左弦、夏史\",\"artistBirthdayYear\":\"1925\",\"artistBirthdayMonth\":\"3\",\"artistBirthdayDay\":\"1\",\"nationDict\":\"1\",\"politicalStatusDict\":\"1\",\"artistIntroduction\":\"吴宗锡，男，汉族，1925年生，江苏苏州人。笔名左弦、夏史、程芷、虞襄等。评弹理论家、作家。先后担任上海市文联副主席、上海市曲协主席、江浙沪评弹工作领导小组组长、中国曲艺音乐集成上海卷及中国曲艺志上海卷主编。\\n      评弹作品有短篇《党员登记表》，中篇《白虎岭》、《人强马壮》、《王孝和》、《芦苇青青》、《晴雯》（均与他人合作）等，此外，还改编了开篇《新木兰辞》，编写开篇《红纸伞》等。为《中国曲艺志》及《曲艺音乐集成》上海卷主编。与周良，何占春合称评弹三剑客。\",\"currentAddressDict\":\"310000\",\"nationalityDict\":\"1\",\"zodiacDict\":\"2\",\"constellationDict\":\"2\",\"createTime\":\"2015-11-12 10:47:27\",\"createUser\":\"c8f1ba6c7cf842409aba43206e9f7442\",\"lastmodifyTime\":\"2015-11-12 10:49:03\",\"lastmodifyUser\":\"0e218205a8f641a8988e742e81014568\",\"artistId\":\"eb0cdb6159c54ea68d695e11ae190a5c\"},\"_positions\":[],\"_delPositions\":[],\"_artistOrgs\":[],\"_delArtistOrgs\":[],\"_awards\":[],\"_delAwards\":[],\"_educations\":[],\"_delEducations\":[],\"_works\":[],\"_delWorks\":[],\"_trains\":[],\"_delTrains\":[],\"_newsArtistRels\":[],\"_delNewsArtistRels\":[],\"_teacherStudents\":[],\"_delTeacherStudents\":[],\"_artistSects\":[],\"_delArtistSects\":[],\"_delArtistSubtypes\":[]}', '7e08beb642b64cdc992342bd26ce83c0', 'e5509da9c73b4db5b37378be2341cbd0', null);
