INSERT INTO `t_artist_info` VALUES ('eb0cdb6159c54ea68d695e11ae190a5c', '吴宗锡', '左弦、夏史', null, '1925', '3', '1', '0', '0', '0', '1', null, null, null, '1', '1', '310000', null, null, null, null, null, null, null, null, null, null, null, null, '吴宗锡，男，汉族，1925年生，江苏苏州人。笔名左弦、夏史、程芷、虞襄等。评弹理论家、作家。先后担任上海市文联副主席、上海市曲协主席、江浙沪评弹工作领导小组组长、中国曲艺音乐集成上海卷及中国曲艺志上海卷主编。\n      评弹作品有短篇《党员登记表》，中篇《白虎岭》、《人强马壮》、《王孝和》、《芦苇青青》、《晴雯》（均与他人合作）等，此外，还改编了开篇《新木兰辞》，编写开篇《红纸伞》等。为《中国曲艺志》及《曲艺音乐集成》上海卷主编。与周良，何占春合称评弹三剑客。', 'N', 'D003', '2015-11-12 10:49:46', '8b9b52afb852480c9eb226ec0b283649', '2015-11-12 10:49:46', '8b9b52afb852480c9eb226ec0b283649', 'I', 'N', null, '2', null, null, null, null, null, null, '2', null, null, '1', null);
