INSERT INTO `t_artist_work` VALUES ('36f6b23c-d5d4-4cf7-a3f7-ca47687dbf50', 'b7740fb1b1a94493876bb7f2ec06fe9c', '1979', '5', '1', '1983', '5', '1', '中国曲艺家协会', '秘书长', null, '01234567890123456789012345678901', '2015-11-12 10:16:05', '8b9b52afb852480c9eb226ec0b283649', '2015-11-12 10:16:05', '8b9b52afb852480c9eb226ec0b283649', 'I', 'N');
INSERT INTO `t_artist_work` VALUES ('43154b31-2e24-4580-b8cf-b48ecc9712e9', 'b64110793a534885ad99b73fe9fe5c65', '2006', '0', '0', '0', '0', '0', '北京拾捌文化经纪有限公司', null, '2007年出演拍摄了都市情感偶像剧《幸福在哪里》，饰演角色甘露。\n2009年出演青春励志剧《我的青春谁做主》 ，剧中白百何扮演“雷蕾”一角。\n年末，出演家庭电视剧《说谎的爱人》“董楠”一角。\n2010年出演都市家庭电视剧《家的N次方》扮演角色赵雯。\n2011年主演都市爱情电影《万有引力》，饰演角色女安检石晓琳。\n2011年出演爱情电影《失恋33天》，饰演黄小仙，并获得第31届大众电影百花奖最佳女主角奖。\n2012年出演都市职场情感电视剧《浮沉》，剧中白百何饰演角色“乔莉”。\n同年相继参演了《整容日记》《分手合约》等电影并担纲女主角， 2012年主演当代都市情感剧《离婚前规则》，白百何出演角色蒋新瑶。\n2013年在电影《分手合约》中出演角色何俏俏。在电影《被偷走的那五年》出演角色何蔓。在电影《私人定制》演绎角色小白 。\n2013年一年之中登上19个知名时尚杂志的封面，白百何成为年度杂志封面人物 。\n2014年衔主演中国首部整容题材喜剧电影《整容日记》，饰演郭晶。\n3月参演青春励志剧《长大》。\n11月，白百何领衔主演爱情电影《新娘日记》。\n2015年1月，白百何与吴彦祖合作主演《滚蛋吧肿瘤君》。', '01234567890123456789012345678901', '2015-11-12 09:59:25', '8b9b52afb852480c9eb226ec0b283649', '2015-11-12 09:59:25', '8b9b52afb852480c9eb226ec0b283649', 'I', 'N');
