INSERT INTO `t_encyclopedia_info` VALUES ('1f05c156b5c84346925a7a47b94d35ac', '11111111', '760K000', '76035', '11111111111', '111111111', null, '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: \n		20px; background-color: rgb(53, 151, 250); border-right-color: rgb(5, 89, 175); border-right-style: solid; \n		border-right-width: 3px; position: absolute; left: 18px; top: 15px;\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; \n			border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"1\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"2\" class=\"bold\" href=\"#H14\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"3\" class=\"bold\" href=\"#H18\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 个人生活</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-family : 宋体; font-size : 25px; font-weight : bold\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n<!--  -->		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; font-family: arial, sans-serif; font-size: 14px;text-indent: 2em; zoom: 1;\">\n			<img data-img=\"mod_img\" id=\"img_9132447\" src=\"http://i2.qhimg.com/dr/200__/t01b71ed92dd811b23b.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" /></p>\n		<p style=\"margin: 0px 0px 15px; padding 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			李雪健1954年2月出生于山东菏泽市的农民家庭。1965年，11岁的​李雪健随父亲 前往贵州三线支边，16岁进工厂劳动，在中学、工厂、部队均为业余文艺宣传队演员。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1973年，19岁的李雪健参军，1976年调入<a href=\"http://baike.haosou.com/doc/2198296.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国人民解放军</a>二炮文工团话剧队，1977年考入空政文工团，1978年进入中央实验话剧院 。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			李雪健，1954年出生于山东省菏泽市巨野县，中国内地影视男演员，<a href=\"http://baike.haosou.com/doc/7801562.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国文学艺术</a>界联合会副主席，<a href=\"http://baike.haosou.com/doc/6405422.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国电影家协会</a>主席。李雪健1973年入伍，1977年考入空政文工团，1978年入<a href=\"http://baike.haosou.com/doc/6657347.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中央实验话剧院</a>&nbsp;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			1980年因在话剧《九&middot;一三事件》中扮演<a href=\"http://baike.haosou.com/doc/1395940.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">林彪</a>，夺得中国戏剧最高奖&ldquo;梅花奖&rdquo;。1985年李雪健在影片《<a href=\"http://baike.haosou.com/doc/7908679.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">钢锉将军</a>》中扮演将军李力；1990年，在电视剧《<a href=\"http://baike.haosou.com/doc/486543-515280.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》中出演好人宋大成，夺得飞天奖最佳男配角奖和第九届金鹰奖最佳男主角奖 ；主演电影《<a href=\"http://baike.haosou.com/doc/5330741-7633735.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》获得<a href=\"http://baike.haosou.com/doc/2442671.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第11届中国电影金鸡奖</a>最佳男主角奖和<a href=\"http://baike.haosou.com/doc/8006556.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第14届大众电影百花奖</a>最佳男演员奖。1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161-2583379.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演<a href=\"http://baike.haosou.com/doc/5352223-5587681.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">宋江</a>。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			2000年被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，2002年复出拍片。 2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277-6981102.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影华表奖优秀男演员奖； 2012年，凭借电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》夺得<a href=\"http://baike.haosou.com/doc/6999561.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第50届台湾电影金马奖</a>最佳男配角奖。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H14\" name=\"H14\"></a> 演艺经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1980年，李雪健参演第一部银幕作品《天山行》，扮演指导员于海洲；同年，凭 借话剧《九&middot;一三事件》林彪一角，夺得首届&ldquo;梅花奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"2\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01069d90d5cb02cb47.jpg\"><img alt=\"李雪健剧照\" data-img=\"mod_img\" id=\"img_9117769\" src=\"http://i2.qhimg.com/dr/200__/t01069d90d5cb02cb47.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健剧照\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1987年，受田壮壮导演之邀，在电影《<a href=\"http://baike.haosou.com/doc/5417549.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼓书艺人</a>》中饰演老艺人方宝庆。1988年李雪健又在《<a href=\"http://baike.haosou.com/doc/2739648.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">大侦探</a>》中扮演旧时代一个机敏狭义、耿直幽默私家侦探杜义甫。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1990年，主演电影《<a href=\"http://baike.haosou.com/doc/5330741.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》饰演焦裕禄，凭借《 焦裕禄》获得第十一届中国电影<a href=\"http://baike.haosou.com/doc/6299621.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金鸡奖</a>最佳男主角奖，和第十四届电影百花奖最佳男 演员奖；同年，参演室内电视连续剧《<a href=\"http://baike.haosou.com/doc/486543.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》，扮演邻家大哥宋大成，夺得第十一 届飞天奖最佳男配角奖第九届金鹰奖最佳男主角奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1992年，在<a href=\"http://baike.haosou.com/doc/2356981.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李少红</a>导演的电影《<a href=\"http://baike.haosou.com/doc/5390966.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">四十不惑</a>》饰演知识分子曹德培；1995年，参演<a href=\"http://baike.haosou.com/doc/3947205.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">张艺谋</a>影片《<a href=\"http://baike.haosou.com/doc/1195807.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">摇啊摇，摇到外婆桥</a>》，饰演配角&ldquo;六 叔&rdquo;；1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演宋江。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2000年11月份，李雪健在拍戏时被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，当时，他正在<a href=\"http://baike.haosou.com/doc/1639651.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">陕西</a>参加一部描写高科技军事 题材的电视连续剧《<a href=\"http://baike.haosou.com/doc/1456397.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国轨道</a>》的拍摄。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2002年，李雪健复出拍片，在以税务为题材的故事片《<a href=\"http://baike.haosou.com/doc/1052943.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">至高无上</a>》中塑造国家税务稽查员老李。2003年，李雪健有开始参与拍摄《<a href=\"http://baike.haosou.com/doc/1109246.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国故事</a>》在剧中的一集《老师的故事》里扮演一位默默无闻的乡村教师。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"3\" data-type=\"gallery\" href=\"http://i8.qhimg.com/t011b346c3c878fccab.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117770\" src=\"http://i8.qhimg.com/dr/200__/t011b346c3c878fccab.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影 华表奖优秀男演员奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2012年11月，参演电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》，并凭借电影《一九四二》夺得第50届台湾电影<a href=\"http://baike.haosou.com/doc/1319619.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金马奖</a>最佳男配角奖。2013年3月31日，首届&ldquo;中央电视台中国电视剧年度明星<a href=\"http://baike.haosou.com/doc/1345486.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">盛典</a>&rdquo;从艺近40年的著名演员李雪健获得&ldquo;年度终身成就奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2013年，参演电影《<a href=\"http://baike.haosou.com/doc/7637123.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">背条大路回故乡</a>》。2014年， 参演电视剧《嘿，老头！》。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H18\" name=\"H18\"></a><br />\n	个人生活</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"4\" data-type=\"gallery\" href=\"http://i6.qhimg.com/t0183852a0b9335dc10.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117773\" src=\"http://i6.qhimg.com/dr/200__/t0183852a0b9335dc10.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1983年，李雪健和同是演员的于海丹举行简单朴素的婚礼，育有一子<a href=\"http://baike.haosou.com/doc/7892919.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李亘</a>，并考上<a href=\"http://baike.haosou.com/doc/6673343.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">北京电影学院导演系</a>的研究生。</p>\n	</div>\n</div>\n', 'N', 'I', '2015-11-06 18:35:59', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 18:35:59', 'c8f1ba6c7cf842409aba43206e9f7442', 'I', 'N');
INSERT INTO `t_encyclopedia_info` VALUES ('2b3a1f55aaa8488ea2258a154e48bb71', 'hhhhhhhhhh', '76020', '76045', 'vvvvvvvvvv', 'hhhhhhhhh', null, '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: \n		20px; background-color: rgb(53, 151, 250); border-right-color: rgb(5, 89, 175); border-right-style: solid; \n		border-right-width: 3px; position: absolute; left: 18px; top: 15px;\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; \n			border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"1\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"2\" class=\"bold\" href=\"#H14\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"3\" class=\"bold\" href=\"#H18\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 个人生活</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-family : 宋体; font-size : 25px; font-weight : bold\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; font-family: arial, sans-serif; font-size: 14px;text-indent: 2em; zoom: 1;\">\n			<img data-img=\"mod_img\" id=\"img_9132447\" src=\"http://i2.qhimg.com/dr/200__/t01b71ed92dd811b23b.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" /></p>\n		<p style=\"margin: 0px 0px 15px; padding 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			李雪健1954年2月出生于山东菏泽市的农民家庭。1965年，11岁的​李雪健随父亲 前往贵州三线支边，16岁进工厂劳动，在中学、工厂、部队均为业余文艺宣传队演员。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1973年，19岁的李雪健参军，1976年调入<a href=\"http://baike.haosou.com/doc/2198296.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国人民解放军</a>二炮文工团话剧队，1977年考入空政文工团，1978年进入中央实验话剧院 。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			李雪健，1954年出生于山东省菏泽市巨野县，中国内地影视男演员，<a href=\"http://baike.haosou.com/doc/7801562.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国文学艺术</a>界联合会副主席，<a href=\"http://baike.haosou.com/doc/6405422.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国电影家协会</a>主席。李雪健1973年入伍，1977年考入空政文工团，1978年入<a href=\"http://baike.haosou.com/doc/6657347.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中央实验话剧院</a>&nbsp;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			1980年因在话剧《九&middot;一三事件》中扮演<a href=\"http://baike.haosou.com/doc/1395940.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">林彪</a>，夺得中国戏剧最高奖&ldquo;梅花奖&rdquo;。1985年李雪健在影片《<a href=\"http://baike.haosou.com/doc/7908679.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">钢锉将军</a>》中扮演将军李力；1990年，在电视剧《<a href=\"http://baike.haosou.com/doc/486543-515280.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》中出演好人宋大成，夺得飞天奖最佳男配角奖和第九届金鹰奖最佳男主角奖 ；主演电影《<a href=\"http://baike.haosou.com/doc/5330741-7633735.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》获得<a href=\"http://baike.haosou.com/doc/2442671.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第11届中国电影金鸡奖</a>最佳男主角奖和<a href=\"http://baike.haosou.com/doc/8006556.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第14届大众电影百花奖</a>最佳男演员奖。1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161-2583379.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演<a href=\"http://baike.haosou.com/doc/5352223-5587681.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">宋江</a>。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			2000年被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，2002年复出拍片。 2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277-6981102.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影华表奖优秀男演员奖； 2012年，凭借电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》夺得<a href=\"http://baike.haosou.com/doc/6999561.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第50届台湾电影金马奖</a>最佳男配角奖。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H14\" name=\"H14\"></a> 演艺经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1980年，李雪健参演第一部银幕作品《天山行》，扮演指导员于海洲；同年，凭 借话剧《九&middot;一三事件》林彪一角，夺得首届&ldquo;梅花奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"2\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01069d90d5cb02cb47.jpg\"><img alt=\"李雪健剧照\" data-img=\"mod_img\" id=\"img_9117769\" src=\"http://i2.qhimg.com/dr/200__/t01069d90d5cb02cb47.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健剧照\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1987年，受田壮壮导演之邀，在电影《<a href=\"http://baike.haosou.com/doc/5417549.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼓书艺人</a>》中饰演老艺人方宝庆。1988年李雪健又在《<a href=\"http://baike.haosou.com/doc/2739648.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">大侦探</a>》中扮演旧时代一个机敏狭义、耿直幽默私家侦探杜义甫。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1990年，主演电影《<a href=\"http://baike.haosou.com/doc/5330741.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》饰演焦裕禄，凭借《 焦裕禄》获得第十一届中国电影<a href=\"http://baike.haosou.com/doc/6299621.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金鸡奖</a>最佳男主角奖，和第十四届电影百花奖最佳男 演员奖；同年，参演室内电视连续剧《<a href=\"http://baike.haosou.com/doc/486543.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》，扮演邻家大哥宋大成，夺得第十一 届飞天奖最佳男配角奖第九届金鹰奖最佳男主角奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1992年，在<a href=\"http://baike.haosou.com/doc/2356981.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李少红</a>导演的电影《<a href=\"http://baike.haosou.com/doc/5390966.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">四十不惑</a>》饰演知识分子曹德培；1995年，参演<a href=\"http://baike.haosou.com/doc/3947205.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">张艺谋</a>影片《<a href=\"http://baike.haosou.com/doc/1195807.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">摇啊摇，摇到外婆桥</a>》，饰演配角&ldquo;六 叔&rdquo;；1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演宋江。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2000年11月份，李雪健在拍戏时被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，当时，他正在<a href=\"http://baike.haosou.com/doc/1639651.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">陕西</a>参加一部描写高科技军事 题材的电视连续剧《<a href=\"http://baike.haosou.com/doc/1456397.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国轨道</a>》的拍摄。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2002年，李雪健复出拍片，在以税务为题材的故事片《<a href=\"http://baike.haosou.com/doc/1052943.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">至高无上</a>》中塑造国家税务稽查员老李。2003年，李雪健有开始参与拍摄《<a href=\"http://baike.haosou.com/doc/1109246.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国故事</a>》在剧中的一集《老师的故事》里扮演一位默默无闻的乡村教师。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"3\" data-type=\"gallery\" href=\"http://i8.qhimg.com/t011b346c3c878fccab.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117770\" src=\"http://i8.qhimg.com/dr/200__/t011b346c3c878fccab.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影 华表奖优秀男演员奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2012年11月，参演电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》，并凭借电影《一九四二》夺得第50届台湾电影<a href=\"http://baike.haosou.com/doc/1319619.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金马奖</a>最佳男配角奖。2013年3月31日，首届&ldquo;中央电视台中国电视剧年度明星<a href=\"http://baike.haosou.com/doc/1345486.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">盛典</a>&rdquo;从艺近40年的著名演员李雪健获得&ldquo;年度终身成就奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2013年，参演电影《<a href=\"http://baike.haosou.com/doc/7637123.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">背条大路回故乡</a>》。2014年， 参演电视剧《嘿，老头！》。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H18\" name=\"H18\"></a><br />\n	个人生活</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"4\" data-type=\"gallery\" href=\"http://i6.qhimg.com/t0183852a0b9335dc10.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117773\" src=\"http://i6.qhimg.com/dr/200__/t0183852a0b9335dc10.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1983年，李雪健和同是演员的于海丹举行简单朴素的婚礼，育有一子<a href=\"http://baike.haosou.com/doc/7892919.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李亘</a>，并考上<a href=\"http://baike.haosou.com/doc/6673343.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">北京电影学院导演系</a>的研究生。</p>\n	</div>\n</div>\n', 'N', 'I', '2015-11-06 18:18:50', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 18:18:50', 'c8f1ba6c7cf842409aba43206e9f7442', 'I', 'N');
INSERT INTO `t_encyclopedia_info` VALUES ('2dc32a20ae5c46a78642ae446510336c', 'ddddddddd', '76045', '76015', 'ddddddddddd', 'dddddddddd', 'I', '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: \n		20px; background-color: rgb(53, 151, 250); border-right-color: rgb(5, 89, 175); border-right-style: solid; \n		border-right-width: 3px; position: absolute; left: 18px; top: 15px;\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; \n			border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"1\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"2\" class=\"bold\" href=\"#H14\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"3\" class=\"bold\" href=\"#H18\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 个人生活</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-family : 宋体; font-size : 25px; font-weight : bold\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<a data-index=\"1\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01b71ed92dd811b23b.jpg\"><img data-img=\"mod_img\" id=\"img_9132447\" src=\"http://i2.qhimg.com/dr/200__/t01b71ed92dd811b23b.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" /></a>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; font-family: arial, sans-serif; font-size: 14px;text-indent: 2em; zoom: 1;\">\n			&nbsp;</p>\n		<p style=\"margin: 0px 0px 15px; padding 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			李雪健1954年2月出生于山东菏泽市的农民家庭。1965年，11岁的​李雪健随父亲 前往贵州三线支边，16岁进工厂劳动，在中学、工厂、部队均为业余文艺宣传队演员。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1973年，19岁的李雪健参军，1976年调入<a href=\"http://baike.haosou.com/doc/2198296.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国人民解放军</a>二炮文工团话剧队，1977年考入空政文工团，1978年进入中央实验话剧院 。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			李雪健，1954年出生于山东省菏泽市巨野县，中国内地影视男演员，<a href=\"http://baike.haosou.com/doc/7801562.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国文学艺术</a>界联合会副主席，<a href=\"http://baike.haosou.com/doc/6405422.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国电影家协会</a>主席。李雪健1973年入伍，1977年考入空政文工团，1978年入<a href=\"http://baike.haosou.com/doc/6657347.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中央实验话剧院</a>&nbsp;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			1980年因在话剧《九&middot;一三事件》中扮演<a href=\"http://baike.haosou.com/doc/1395940.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">林彪</a>，夺得中国戏剧最高奖&ldquo;梅花奖&rdquo;。1985年李雪健在影片《<a href=\"http://baike.haosou.com/doc/7908679.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">钢锉将军</a>》中扮演将军李力；1990年，在电视剧《<a href=\"http://baike.haosou.com/doc/486543-515280.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》中出演好人宋大成，夺得飞天奖最佳男配角奖和第九届金鹰奖最佳男主角奖 ；主演电影《<a href=\"http://baike.haosou.com/doc/5330741-7633735.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》获得<a href=\"http://baike.haosou.com/doc/2442671.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第11届中国电影金鸡奖</a>最佳男主角奖和<a href=\"http://baike.haosou.com/doc/8006556.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第14届大众电影百花奖</a>最佳男演员奖。1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161-2583379.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演<a href=\"http://baike.haosou.com/doc/5352223-5587681.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">宋江</a>。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			2000年被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，2002年复出拍片。 2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277-6981102.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影华表奖优秀男演员奖； 2012年，凭借电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》夺得<a href=\"http://baike.haosou.com/doc/6999561.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第50届台湾电影金马奖</a>最佳男配角奖。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H14\" name=\"H14\"></a> 演艺经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1980年，李雪健参演第一部银幕作品《天山行》，扮演指导员于海洲；同年，凭 借话剧《九&middot;一三事件》林彪一角，夺得首届&ldquo;梅花奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"2\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01069d90d5cb02cb47.jpg\"><img alt=\"李雪健剧照\" data-img=\"mod_img\" id=\"img_9117769\" src=\"http://i2.qhimg.com/dr/200__/t01069d90d5cb02cb47.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健剧照\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1987年，受田壮壮导演之邀，在电影《<a href=\"http://baike.haosou.com/doc/5417549.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼓书艺人</a>》中饰演老艺人方宝庆。1988年李雪健又在《<a href=\"http://baike.haosou.com/doc/2739648.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">大侦探</a>》中扮演旧时代一个机敏狭义、耿直幽默私家侦探杜义甫。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1990年，主演电影《<a href=\"http://baike.haosou.com/doc/5330741.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》饰演焦裕禄，凭借《 焦裕禄》获得第十一届中国电影<a href=\"http://baike.haosou.com/doc/6299621.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金鸡奖</a>最佳男主角奖，和第十四届电影百花奖最佳男 演员奖；同年，参演室内电视连续剧《<a href=\"http://baike.haosou.com/doc/486543.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》，扮演邻家大哥宋大成，夺得第十一 届飞天奖最佳男配角奖第九届金鹰奖最佳男主角奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1992年，在<a href=\"http://baike.haosou.com/doc/2356981.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李少红</a>导演的电影《<a href=\"http://baike.haosou.com/doc/5390966.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">四十不惑</a>》饰演知识分子曹德培；1995年，参演<a href=\"http://baike.haosou.com/doc/3947205.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">张艺谋</a>影片《<a href=\"http://baike.haosou.com/doc/1195807.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">摇啊摇，摇到外婆桥</a>》，饰演配角&ldquo;六 叔&rdquo;；1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演宋江。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2000年11月份，李雪健在拍戏时被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，当时，他正在<a href=\"http://baike.haosou.com/doc/1639651.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">陕西</a>参加一部描写高科技军事 题材的电视连续剧《<a href=\"http://baike.haosou.com/doc/1456397.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国轨道</a>》的拍摄。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2002年，李雪健复出拍片，在以税务为题材的故事片《<a href=\"http://baike.haosou.com/doc/1052943.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">至高无上</a>》中塑造国家税务稽查员老李。2003年，李雪健有开始参与拍摄《<a href=\"http://baike.haosou.com/doc/1109246.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国故事</a>》在剧中的一集《老师的故事》里扮演一位默默无闻的乡村教师。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"3\" data-type=\"gallery\" href=\"http://i8.qhimg.com/t011b346c3c878fccab.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117770\" src=\"http://i8.qhimg.com/dr/200__/t011b346c3c878fccab.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影 华表奖优秀男演员奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2012年11月，参演电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》，并凭借电影《一九四二》夺得第50届台湾电影<a href=\"http://baike.haosou.com/doc/1319619.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金马奖</a>最佳男配角奖。2013年3月31日，首届&ldquo;中央电视台中国电视剧年度明星<a href=\"http://baike.haosou.com/doc/1345486.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">盛典</a>&rdquo;从艺近40年的著名演员李雪健获得&ldquo;年度终身成就奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2013年，参演电影《<a href=\"http://baike.haosou.com/doc/7637123.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">背条大路回故乡</a>》。2014年， 参演电视剧《嘿，老头！》。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H18\" name=\"H18\"></a><br />\n	个人生活</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"4\" data-type=\"gallery\" href=\"http://i6.qhimg.com/t0183852a0b9335dc10.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117773\" src=\"http://i6.qhimg.com/dr/200__/t0183852a0b9335dc10.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1983年，李雪健和同是演员的于海丹举行简单朴素的婚礼，育有一子<a href=\"http://baike.haosou.com/doc/7892919.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李亘</a>，并考上<a href=\"http://baike.haosou.com/doc/6673343.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">北京电影学院导演系</a>的研究生。</p>\n	</div>\n</div>\n', 'N', 'CSSCSS', '2015-11-02 14:18:47', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 18:23:11', 'c8f1ba6c7cf842409aba43206e9f7442', 'D', 'Y');
INSERT INTO `t_encyclopedia_info` VALUES ('3c5c66ddea554c9584c7406d21b09ec2', 'aaaaaaaaaaaa', '76015', '76030', 'aaaaaaaaaaaaaaa', 'aaaaaaaaaaa', null, '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: \n		20px; background-color: rgb(53, 151, 250); border-right-color: rgb(5, 89, 175); border-right-style: solid; \n		border-right-width: 3px; position: absolute; left: 18px; top: 15px;\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; \n			border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"1\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"2\" class=\"bold\" href=\"#H14\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"3\" class=\"bold\" href=\"#H18\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 个人生活</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-family : 宋体; font-size : 25px; font-weight : bold\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n<!--  -->		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; font-family: arial, sans-serif; font-size: 14px;text-indent: 2em; zoom: 1;\">\n			<img data-img=\"mod_img\" id=\"img_9132447\" src=\"http://i2.qhimg.com/dr/200__/t01b71ed92dd811b23b.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" /></p>\n		<p style=\"margin: 0px 0px 15px; padding 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			李雪健1954年2月出生于山东菏泽市的农民家庭。1965年，11岁的​李雪健随父亲 前往贵州三线支边，16岁进工厂劳动，在中学、工厂、部队均为业余文艺宣传队演员。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1973年，19岁的李雪健参军，1976年调入<a href=\"http://baike.haosou.com/doc/2198296.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国人民解放军</a>二炮文工团话剧队，1977年考入空政文工团，1978年进入中央实验话剧院 。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			李雪健，1954年出生于山东省菏泽市巨野县，中国内地影视男演员，<a href=\"http://baike.haosou.com/doc/7801562.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国文学艺术</a>界联合会副主席，<a href=\"http://baike.haosou.com/doc/6405422.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国电影家协会</a>主席。李雪健1973年入伍，1977年考入空政文工团，1978年入<a href=\"http://baike.haosou.com/doc/6657347.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中央实验话剧院</a>&nbsp;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			1980年因在话剧《九&middot;一三事件》中扮演<a href=\"http://baike.haosou.com/doc/1395940.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">林彪</a>，夺得中国戏剧最高奖&ldquo;梅花奖&rdquo;。1985年李雪健在影片《<a href=\"http://baike.haosou.com/doc/7908679.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">钢锉将军</a>》中扮演将军李力；1990年，在电视剧《<a href=\"http://baike.haosou.com/doc/486543-515280.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》中出演好人宋大成，夺得飞天奖最佳男配角奖和第九届金鹰奖最佳男主角奖 ；主演电影《<a href=\"http://baike.haosou.com/doc/5330741-7633735.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》获得<a href=\"http://baike.haosou.com/doc/2442671.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第11届中国电影金鸡奖</a>最佳男主角奖和<a href=\"http://baike.haosou.com/doc/8006556.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第14届大众电影百花奖</a>最佳男演员奖。1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161-2583379.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演<a href=\"http://baike.haosou.com/doc/5352223-5587681.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">宋江</a>。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			2000年被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，2002年复出拍片。 2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277-6981102.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影华表奖优秀男演员奖； 2012年，凭借电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》夺得<a href=\"http://baike.haosou.com/doc/6999561.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第50届台湾电影金马奖</a>最佳男配角奖。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H14\" name=\"H14\"></a> 演艺经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1980年，李雪健参演第一部银幕作品《天山行》，扮演指导员于海洲；同年，凭 借话剧《九&middot;一三事件》林彪一角，夺得首届&ldquo;梅花奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"2\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01069d90d5cb02cb47.jpg\"><img alt=\"李雪健剧照\" data-img=\"mod_img\" id=\"img_9117769\" src=\"http://i2.qhimg.com/dr/200__/t01069d90d5cb02cb47.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健剧照\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1987年，受田壮壮导演之邀，在电影《<a href=\"http://baike.haosou.com/doc/5417549.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼓书艺人</a>》中饰演老艺人方宝庆。1988年李雪健又在《<a href=\"http://baike.haosou.com/doc/2739648.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">大侦探</a>》中扮演旧时代一个机敏狭义、耿直幽默私家侦探杜义甫。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1990年，主演电影《<a href=\"http://baike.haosou.com/doc/5330741.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》饰演焦裕禄，凭借《 焦裕禄》获得第十一届中国电影<a href=\"http://baike.haosou.com/doc/6299621.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金鸡奖</a>最佳男主角奖，和第十四届电影百花奖最佳男 演员奖；同年，参演室内电视连续剧《<a href=\"http://baike.haosou.com/doc/486543.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》，扮演邻家大哥宋大成，夺得第十一 届飞天奖最佳男配角奖第九届金鹰奖最佳男主角奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1992年，在<a href=\"http://baike.haosou.com/doc/2356981.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李少红</a>导演的电影《<a href=\"http://baike.haosou.com/doc/5390966.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">四十不惑</a>》饰演知识分子曹德培；1995年，参演<a href=\"http://baike.haosou.com/doc/3947205.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">张艺谋</a>影片《<a href=\"http://baike.haosou.com/doc/1195807.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">摇啊摇，摇到外婆桥</a>》，饰演配角&ldquo;六 叔&rdquo;；1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演宋江。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2000年11月份，李雪健在拍戏时被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，当时，他正在<a href=\"http://baike.haosou.com/doc/1639651.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">陕西</a>参加一部描写高科技军事 题材的电视连续剧《<a href=\"http://baike.haosou.com/doc/1456397.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国轨道</a>》的拍摄。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2002年，李雪健复出拍片，在以税务为题材的故事片《<a href=\"http://baike.haosou.com/doc/1052943.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">至高无上</a>》中塑造国家税务稽查员老李。2003年，李雪健有开始参与拍摄《<a href=\"http://baike.haosou.com/doc/1109246.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国故事</a>》在剧中的一集《老师的故事》里扮演一位默默无闻的乡村教师。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"3\" data-type=\"gallery\" href=\"http://i8.qhimg.com/t011b346c3c878fccab.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117770\" src=\"http://i8.qhimg.com/dr/200__/t011b346c3c878fccab.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影 华表奖优秀男演员奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2012年11月，参演电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》，并凭借电影《一九四二》夺得第50届台湾电影<a href=\"http://baike.haosou.com/doc/1319619.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金马奖</a>最佳男配角奖。2013年3月31日，首届&ldquo;中央电视台中国电视剧年度明星<a href=\"http://baike.haosou.com/doc/1345486.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">盛典</a>&rdquo;从艺近40年的著名演员李雪健获得&ldquo;年度终身成就奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2013年，参演电影《<a href=\"http://baike.haosou.com/doc/7637123.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">背条大路回故乡</a>》。2014年， 参演电视剧《嘿，老头！》。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H18\" name=\"H18\"></a><br />\n	个人生活</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"4\" data-type=\"gallery\" href=\"http://i6.qhimg.com/t0183852a0b9335dc10.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117773\" src=\"http://i6.qhimg.com/dr/200__/t0183852a0b9335dc10.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1983年，李雪健和同是演员的于海丹举行简单朴素的婚礼，育有一子<a href=\"http://baike.haosou.com/doc/7892919.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李亘</a>，并考上<a href=\"http://baike.haosou.com/doc/6673343.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">北京电影学院导演系</a>的研究生。</p>\n	</div>\n</div>\n', 'N', 'I', '2015-11-06 18:36:14', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 18:36:14', 'c8f1ba6c7cf842409aba43206e9f7442', 'I', 'N');
INSERT INTO `t_encyclopedia_info` VALUES ('527199bca6a14fe7b715f4905ba305d6', 'wwww', '76035', '760K004', 'wwwwwwww', 'wwwwwww', 'I', '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: \n		20px; background-color: rgb(53, 151, 250); border-right-color: rgb(5, 89, 175); border-right-style: solid; \n		border-right-width: 3px; position: absolute; left: 18px; top: 15px;\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; \n			border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"1\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"2\" class=\"bold\" href=\"#H14\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 14px; word-break: break-all;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 207); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"3\" class=\"bold\" href=\"#H18\" style=\"color: rgb(2, 104, 205); font-weight: bold;\" title=\"一级目录\"> 个人生活</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-family : 宋体; font-size : 25px; font-weight : bold\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<a data-index=\"1\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01b71ed92dd811b23b.jpg\"><img data-img=\"mod_img\" id=\"img_9132447\" src=\"http://i2.qhimg.com/dr/200__/t01b71ed92dd811b23b.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" /></a>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; font-family: arial, sans-serif; font-size: 14px;text-indent: 2em; zoom: 1;\">\n			&nbsp;</p>\n		<p style=\"margin: 0px 0px 15px; padding 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			李雪健1954年2月出生于山东菏泽市的农民家庭。1965年，11岁的​李雪健随父亲 前往贵州三线支边，16岁进工厂劳动，在中学、工厂、部队均为业余文艺宣传队演员。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1973年，19岁的李雪健参军，1976年调入<a href=\"http://baike.haosou.com/doc/2198296.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国人民解放军</a>二炮文工团话剧队，1977年考入空政文工团，1978年进入中央实验话剧院 。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			李雪健，1954年出生于山东省菏泽市巨野县，中国内地影视男演员，<a href=\"http://baike.haosou.com/doc/7801562.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国文学艺术</a>界联合会副主席，<a href=\"http://baike.haosou.com/doc/6405422.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国电影家协会</a>主席。李雪健1973年入伍，1977年考入空政文工团，1978年入<a href=\"http://baike.haosou.com/doc/6657347.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中央实验话剧院</a>&nbsp;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			1980年因在话剧《九&middot;一三事件》中扮演<a href=\"http://baike.haosou.com/doc/1395940.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">林彪</a>，夺得中国戏剧最高奖&ldquo;梅花奖&rdquo;。1985年李雪健在影片《<a href=\"http://baike.haosou.com/doc/7908679.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">钢锉将军</a>》中扮演将军李力；1990年，在电视剧《<a href=\"http://baike.haosou.com/doc/486543-515280.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》中出演好人宋大成，夺得飞天奖最佳男配角奖和第九届金鹰奖最佳男主角奖 ；主演电影《<a href=\"http://baike.haosou.com/doc/5330741-7633735.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》获得<a href=\"http://baike.haosou.com/doc/2442671.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第11届中国电影金鸡奖</a>最佳男主角奖和<a href=\"http://baike.haosou.com/doc/8006556.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第14届大众电影百花奖</a>最佳男演员奖。1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161-2583379.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演<a href=\"http://baike.haosou.com/doc/5352223-5587681.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">宋江</a>。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; widows: auto;\">\n			2000年被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，2002年复出拍片。 2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277-6981102.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影华表奖优秀男演员奖； 2012年，凭借电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》夺得<a href=\"http://baike.haosou.com/doc/6999561.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">第50届台湾电影金马奖</a>最佳男配角奖。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H14\" name=\"H14\"></a> 演艺经历</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1980年，李雪健参演第一部银幕作品《天山行》，扮演指导员于海洲；同年，凭 借话剧《九&middot;一三事件》林彪一角，夺得首届&ldquo;梅花奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"2\" data-type=\"gallery\" href=\"http://i2.qhimg.com/t01069d90d5cb02cb47.jpg\"><img alt=\"李雪健剧照\" data-img=\"mod_img\" id=\"img_9117769\" src=\"http://i2.qhimg.com/dr/200__/t01069d90d5cb02cb47.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健剧照\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1987年，受田壮壮导演之邀，在电影《<a href=\"http://baike.haosou.com/doc/5417549.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼓书艺人</a>》中饰演老艺人方宝庆。1988年李雪健又在《<a href=\"http://baike.haosou.com/doc/2739648.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">大侦探</a>》中扮演旧时代一个机敏狭义、耿直幽默私家侦探杜义甫。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1990年，主演电影《<a href=\"http://baike.haosou.com/doc/5330741.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">焦裕禄</a>》饰演焦裕禄，凭借《 焦裕禄》获得第十一届中国电影<a href=\"http://baike.haosou.com/doc/6299621.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金鸡奖</a>最佳男主角奖，和第十四届电影百花奖最佳男 演员奖；同年，参演室内电视连续剧《<a href=\"http://baike.haosou.com/doc/486543.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">渴望</a>》，扮演邻家大哥宋大成，夺得第十一 届飞天奖最佳男配角奖第九届金鹰奖最佳男主角奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1992年，在<a href=\"http://baike.haosou.com/doc/2356981.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李少红</a>导演的电影《<a href=\"http://baike.haosou.com/doc/5390966.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">四十不惑</a>》饰演知识分子曹德培；1995年，参演<a href=\"http://baike.haosou.com/doc/3947205.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">张艺谋</a>影片《<a href=\"http://baike.haosou.com/doc/1195807.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">摇啊摇，摇到外婆桥</a>》，饰演配角&ldquo;六 叔&rdquo;；1998年，参演电视剧《<a href=\"http://baike.haosou.com/doc/2443161.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">水浒传</a>》饰演宋江。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2000年11月份，李雪健在拍戏时被查出患了<a href=\"http://baike.haosou.com/doc/5356804.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">鼻咽癌</a>，当时，他正在<a href=\"http://baike.haosou.com/doc/1639651.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">陕西</a>参加一部描写高科技军事 题材的电视连续剧《<a href=\"http://baike.haosou.com/doc/1456397.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国轨道</a>》的拍摄。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2002年，李雪健复出拍片，在以税务为题材的故事片《<a href=\"http://baike.haosou.com/doc/1052943.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">至高无上</a>》中塑造国家税务稽查员老李。2003年，李雪健有开始参与拍摄《<a href=\"http://baike.haosou.com/doc/1109246.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">中国故事</a>》在剧中的一集《老师的故事》里扮演一位默默无闻的乡村教师。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"3\" data-type=\"gallery\" href=\"http://i8.qhimg.com/t011b346c3c878fccab.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117770\" src=\"http://i8.qhimg.com/dr/200__/t011b346c3c878fccab.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2011年，凭借电影《<a href=\"http://baike.haosou.com/doc/5391277.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">杨善洲</a>》获得第14届中国电影 华表奖优秀男演员奖。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2012年11月，参演电影《<a href=\"http://baike.haosou.com/doc/2131625.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">一九四二</a>》，并凭借电影《一九四二》夺得第50届台湾电影<a href=\"http://baike.haosou.com/doc/1319619.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">金马奖</a>最佳男配角奖。2013年3月31日，首届&ldquo;中央电视台中国电视剧年度明星<a href=\"http://baike.haosou.com/doc/1345486.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">盛典</a>&rdquo;从艺近40年的著名演员李雪健获得&ldquo;年度终身成就奖&rdquo;。</p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			2013年，参演电影《<a href=\"http://baike.haosou.com/doc/7637123.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">背条大路回故乡</a>》。2014年， 参演电视剧《嘿，老头！》。</p>\n	</div>\n</div>\n<h1 class=\"GenDirClass\">\n	<a id=\"H18\" name=\"H18\"></a><br />\n	个人生活</h1>\n<div class=\"sonConBox\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 28px; widows: auto;\">\n	<div class=\"h2_content\" style=\"margin: 0px; padding: 0px;\">\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			<a data-index=\"4\" data-type=\"gallery\" href=\"http://i6.qhimg.com/t0183852a0b9335dc10.jpg\"><img alt=\"李雪健\" data-img=\"mod_img\" id=\"img_9117773\" src=\"http://i6.qhimg.com/dr/200__/t0183852a0b9335dc10.jpg\" style=\"border: none; vertical-align: bottom; display: inline;float:right\" title=\"李雪健\" /></a></p>\n		<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1;\">\n			1983年，李雪健和同是演员的于海丹举行简单朴素的婚礼，育有一子<a href=\"http://baike.haosou.com/doc/7892919.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">李亘</a>，并考上<a href=\"http://baike.haosou.com/doc/6673343.html\" style=\"color: rgb(19, 110, 194); text-decoration: none;\" target=\"_blank\">北京电影学院导演系</a>的研究生。</p>\n	</div>\n</div>\n', 'N', 'CSSCSS', '2015-11-02 14:18:10', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 18:23:11', 'c8f1ba6c7cf842409aba43206e9f7442', 'D', 'Y');
INSERT INTO `t_encyclopedia_info` VALUES ('5d7f63073fb8463cb3c5957610e1c107', 'baike2fdsafd', '76060', '76035', 'guanjinazi2fdsa', 'laiyuan2fdsa', 'I', '<div class=\"DirTitle\" id=\"dirid\" style=\"margin: 0px; padding: 25px 0px 25px 8px; line-height: 30px; width: 20px; border-right-style: solid; border-right-width: 3px; position: absolute; left: 18px; top: 15px; background-color: rgb(53, 151, 250);\">\n	<h3 id=\"dirh3\" style=\"margin: 0px; padding: 0px; color: rgb(255, 255, 255);\">\n		目录</h3>\n</div>\n<div id=\"divul\" style=\"margin: 0px 0px 0px 49px; padding: 8px 0px 0px; border-left-color: rgb(237, 237, 237); border-left-style: solid; border-left-width: 1px; zoom: 1; overflow: hidden;\">\n	<ul class=\"uli3\" style=\"margin: 0px 0px 0px -1px; padding: 0px; width: 218px; float: left; border-left-width: 1px; border-left-style: solid; border-left-color: rgb(245, 245, 245); min-height: 120px;\">\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 15px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 5px;\">1</span><a catalogkey=\"2\" class=\"bold\" href=\"#H10\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 7px;\" title=\"一级目录\"> 早年经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 15px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 5px;\">2</span><a catalogkey=\"3\" class=\"bold\" href=\"#H12\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 7px;\" title=\"一级目录\"> 演艺经历</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H24\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 家庭</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H26\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 感情</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H212\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 参演电影</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H214\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 参演电视剧</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H216\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 音乐作品</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H218\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 导演作品</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 10px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 18px;\">*</span><a catalogkey=\"3\" class=\"bold\" href=\"#H220\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 10px;\" title=\"二级目录\"> 演唱会</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 15px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 5px;\">3</span><a catalogkey=\"4\" class=\"bold\" href=\"#H122\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 7px;\" title=\"一级目录\"> 社会活动</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 15px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 5px;\">4</span><a catalogkey=\"5\" class=\"bold\" href=\"#H124\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 7px;\" title=\"一级目录\"> 荣誉</a></li>\n		<li style=\"margin: 3px 0px 0px; padding: 0px 5px 0px 30px; list-style: none; line-height: 21px; position: relative; font-size: 15px;\">\n			<span style=\"display: block; width: 18px; padding-right: 8px; text-align: right; color: rgb(2, 103, 167); position: absolute; top: 0px; left: 5px;\">5</span><a catalogkey=\"6\" class=\"bold\" href=\"#H126\" style=\"color: rgb(2, 104, 205); font-weight: bold; text-decoration: none; margin-left: 7px;\" title=\"一级目录\"> 评价</a></li>\n	</ul>\n</div>\n<h1 class=\"GenDirClass\" style=\"font-size: 16px; font-weight: bold; font-family: 宋体; line-height: 24px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(222, 223, 225); padding-bottom: 5px; margin: 35px 0px 5px;\">\n	<a id=\"H10\" name=\"H10\"></a> 早年经历</h1>\n<h1 class=\"GenDirClass\" style=\"font-size: 16px; font-weight: bold; font-family: 宋体; line-height: 24px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(222, 223, 225); padding-bottom: 5px; margin: 35px 0px 5px;\">\n	<a id=\"H12\" name=\"H12\"></a> 演艺经历</h1>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H24\" name=\"H24\"></a> 家庭</h2>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H26\" name=\"H26\"></a> 感情</h2>\n<p>\n	ggggggggggggggggg</p>\n<p>\n	ggggggggggg</p>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H212\" name=\"H212\"></a> 参演电影</h2>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H214\" name=\"H214\"></a> 参演电视剧</h2>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H216\" name=\"H216\"></a> 音乐作品</h2>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H218\" name=\"H218\"></a> 导演作品</h2>\n<h2 class=\"GenDirClass\" style=\"font-size: 15px; font-family: Arial; line-height: 22px; margin: 22px 0px 12px;\">\n	<a id=\"H220\" name=\"H220\"></a> 演唱会</h2>\n<h1 class=\"GenDirClass\" style=\"font-size: 16px; font-weight: bold; font-family: 宋体; line-height: 24px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(222, 223, 225); padding-bottom: 5px; margin: 35px 0px 5px;\">\n	<a id=\"H122\" name=\"H122\"></a> 社会活动</h1>\n<h1 class=\"GenDirClass\" style=\"font-size: 16px; font-weight: bold; font-family: 宋体; line-height: 24px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(222, 223, 225); padding-bottom: 5px; margin: 35px 0px 5px;\">\n	<a id=\"H124\" name=\"H124\"></a> 荣誉</h1>\n<h1 class=\"GenDirClass\" style=\"font-size: 16px; font-weight: bold; font-family: 宋体; line-height: 24px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(222, 223, 225); padding-bottom: 5px; margin: 35px 0px 5px;\">\n	<a id=\"H126\" name=\"H126\"></a> 评价</h1>\n', 'N', 'CSSCSS', '2015-10-10 10:10:10', 'CSS', '2015-11-11 11:17:18', 'c8f1ba6c7cf842409aba43206e9f7442', 'D', 'Y');
