INSERT INTO `t_encyclopedia_info` VALUES ('af4e2f1634f84a5a9f7d949e53037df2', 'hhhhhhhhhh', '76020', '76045', 'hhhhhhhhh', 'hhhhhhhhh', null, '<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</span></p>\n<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</span></p>\n<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</span></p>\n<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</span></p>\n<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">1985年，李雪健在影片《钢锉将军》中饰演将军李力，从30岁演到60岁，该片获 &quot;政府奖&quot;优秀影片奖。</span></p>\n', 'N', 'I', '2015-11-06 16:03:18', 'c8f1ba6c7cf842409aba43206e9f7442', '2015-11-06 16:03:18', 'c8f1ba6c7cf842409aba43206e9f7442', 'I', 'N');
